// Expose for debugging / audits
try { window.REPEATER_DATA_LEGACY = REPEATER_DATA_LEGACY; } catch (_) { /* ignore */ }

(function mergeLegacyRepeaters() {
  function clean(s) { return String(s || "").replace(/\s+/g, " ").trim(); }
  function normFreq(f) {
    const n = Number(f);
    return Number.isFinite(n) ? n.toFixed(3) : clean(f);
  }
  function normCoord(n) {
    const v = Number(n);
    return Number.isFinite(v) ? v.toFixed(4) : clean(n);
  }
  function key(r) {
    if (!r) return "";
    return [
      clean(r.country).toUpperCase(),
      clean(r.state).toUpperCase(),
      clean(r.callsign).toUpperCase(),
      normFreq(r.frequency),
      normCoord(r.lat),
      normCoord(r.lng),
      clean(r.band).toLowerCase(),
    ].join("|");
  }

  try {
    const base = Array.isArray(window.repeaterData) ? window.repeaterData : [];
    const legacy = Array.isArray(REPEATER_DATA_LEGACY) ? REPEATER_DATA_LEGACY : [];
    if (!legacy.length) return;

    if (!base.length) {
      window.repeaterData = legacy.slice();
      return;
    }

    const seen = new Set(base.map(key));
    const merged = base.slice();
    for (const r of legacy) {
      const k = key(r);
      if (!k || seen.has(k)) continue;
      seen.add(k);
      merged.push(r);
    }

    window.repeaterData = merged;

    // Best-effort: reflect merged counts
    if (window.REPEATER_DATA_META && typeof window.REPEATER_DATA_META === "object") {
      try { window.REPEATER_DATA_META.recordCount = merged.length; } catch (_) { /* ignore */ }
    }
  } catch (_) { /* ignore */ }
})();
